                        try {
                            if($is_post) { $connection = new PDO('mysql:dbname='.$_POST['mysql_db'].';host='.$_POST['mysql_host'], $_POST['mysql_user'], $_POST['mysql_pass']); }
                        } catch (PDOException $e) {
                            $is_error = true;
                    ?>
                        <tr>
                            <td colspan="2">
                                <div class="icon err"></div> MySQL test error!
                                <br />
